import mc from "./buttons.module.scss";
const Buttons = ({ textBtn, className, link }) => {
  return (
    <form action={link} className={mc.contain} target="_blank">
      <button type="submit" className={`${mc.darkBtn} ${className}`}>
        {textBtn}
      </button>
    </form>
  );
};
export default Buttons;
